import React from "react";

const TableBody = (props) => {
    const rows = props.response.map((row, index) => {
        return (
            <tr key={index}>
                <td>{row.restGjeld}</td>
                <td>{row.dato}</td>
            </tr>
        )
    })

    return <tbody>{rows}</tbody>
}

const Table = (props) => {
    const {response} = props

    return (
        <table class="table">
            <thead  className="thead">
                <tr>
                    <th scope="col">Termin</th>
                    <th scope="col">Terminbel√∏p</th>
                    <th scope="col">Renter</th>
                    <th scope="col">Avdrag</th>
                    <th scope="col">Restgjeld</th>
                </tr>
            </thead>
            <tbody>
                <TableBody response={response} />
            </tbody>
        </table>
    )
}

export default Table;
